import React from 'react';
import styled from 'styled-components';

const BotaoCustomizado = styled.button`
    width: 50px;
    heigth: 15px;
`;
function Botao(props){
    return (
        <BotaoCustomizado>
        Teste do Lero
        </BotaoCustomizado>
    );
}

export default Botao;
